import React from "react";
const cnst_bg = require("../../assets/cnst_bg1.jpg").default;
const Construction = () => {
  return (
    <div>
      <img src={cnst_bg} style={styles.image} />
    </div>
  );
};

const styles = {
  bg: {
    backgroundImage: `url(${cnst_bg})`,
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundSize: "",
    width: "100vw",
    height: "80vh",
    textAlign: "center",
  },
  p: {
    fontSize: 25,
    marginTop: "15%",
    textAlign: "center",
    maxWidth: 700,
  },
  image: {
    width: "100%",
    height: 800,
  },
};
export default Construction;
